PRODUCT DESCRIPTION:.COMPACT AND LIGHT-WEIGHT DESIGN..DOUBLE-EAR MAIN AND SUBSIDIARY EARPIECE DESIGN, INNOVATIVE AND EXCELLENCE..BLUETOOTH 4.2 TECHNOLOGY, BETTER SOUND QUALITY..ADOPT TRUE WIRELESS TECHNOLOGY, ENJOY YOUR WIRELESSLY SPORTS ..INTELLIGENT CHARGING BOX PROVIDES FAST CHARGE, WORRY FREE FOR ENDURANCE..WITH HIGHT CAPACITY LITHIUM BATTERY AND LOW FREQUENCY BALANCED TECHNOLOGY FUNTION..MULTI-FUNCTIONAL BUTTON, ACHIEVED BY ONE CLICK..STRONG COMPATIBILITY, COMPATIBLE WITH DEVICES AS LONG AS THEY ARE BLUETOOTH ENABLES..THREE STEPS TO PAIR, EASY TO USE.SPECIFICATIONS:.TYPE: BLUETOOTH HEADSET.BRAND: DACOM.MODEL: TWS.COLOR: WHITE.BLUETOOTH VERSION: V4.2.DRIVE: 8MM.IMPEDANCE: 16OHMS.POWER LEVEL: CLASS .WORKING VOLTAGE: 3.2V-4.2V.SENSITIVITY: -42DB±2DB.FREQUENCY RANGE: 2.4-2.48GHZ.DISTANCE: &lt;10M.PROFILES: A2DP/AVRCP.COMPATIBILITY: FOR DEVICES WHICH BLUETOOTH ENABLESPACKAGE LIST:2 * HEADSET (MAIN AND SUBSIDIARY)1 * CHARGE BOX1 * USB CABLE2 * EARBUD1 * CARRY BAG1 * USER MANUAL&nbsp;
Compatible with #5705All
Type #5935In Ear

Bluetooth version: 4.1&nbsp;Bluetooth transmission frequency: 2.4GHz to 2.48GHz&nbsp;Bluetooth operating range: up to 33 feet (free space)&nbsp;Bluetooth profiles: A2DP, AVRCP, HSP, HFP&nbsp;Frequency response: 20Hz-20,000Hz&nbsp;Standby time: about 120 hours&nbsp;Bluetooth music/talk time: about 4 hours&nbsp;Charging time: about 2 hours&nbsp;Operating temperature: -10 to 50&nbsp;Input voltage/current: 5V/0.1A&nbsp;Output power: 6mW + 6mW&nbsp;Headphones dimensions: 25*30*21mm&nbsp;Package dimensions: 108*147*54mm&nbsp;Headphones weight: 16g&nbsp;Package weight:250g&nbsp;
Compatible with #5705All
Type: In Ear

